import React from 'react'
import styled from '@emotion/styled'

const Counter = styled.div`
  color: white;
  display: flex;
  align-items: center;
  justify-content: center;
  font-family: GoodTime;
`
const Pagination = ({totalPage}) => {
  return (
    <Counter>
      pagination
    </Counter>
  )
}

export default Pagination
